    <div class="homepage__features-content">
              <h2 class="homepage__features-overline">What Makes Extension Unique</h2>
                  <div class="homepage__features-intro">
        <p>Deep learning springs from human connection. That’s why we work so hard to bring people together — whether in a live virtual classroom or an in-person seminar on campus.</p>

      </div>

            <ul class="homepage__features-list">
                  <li class="homepage__features-list-item">
            <span class="feature-title">Access</span>
            <div class="feature-description"><p>Our flexible pathways and transparent admissions emphasize what you’re capable of today—not a test or course you took years ago.</p>
</div>
          </li>
                  <li class="homepage__features-list-item">
            <span class="feature-title">Quality</span>
            <div class="feature-description"><p>Expect to be challenged. You'll learn from industry experts and faculty from Harvard and peer institutions.</p>
</div>
          </li>
                  <li class="homepage__features-list-item">
            <span class="feature-title">Flexibility </span>
            <div class="feature-description"><p>You're balancing a lot. We get it. Our courses are designed to help you study while managing career and life commitments.</p>
</div>
          </li>
                  <li class="homepage__features-list-item">
            <span class="feature-title">Impact</span>
            <div class="feature-description"><p>Gain meaningful insights and make valuable connections. Then put them to work in your career and life pursuits.  </p>
</div>
          </li>
              </ul>

